"use client";
class r {
  constructor() {
    this.objects = [];
  }
  init(e) {
    let t;
    for (let s = 0; s < e.length; s++)
      s % 5e4 === 0 && (t = {}, this.objects.push(t)), t[e[s]] = !0;
  }
  hasId(e) {
    return this.objects.some((t) => t[e]);
  }
}
export {
  r as SortedPublicItemIds
};
